<body class="register-page" style="min-height: 300px;">
<div class="register-box">
  </div>
     <!-- Brand Logo -->
   <a href="index3.html" class="brand-link" style="display:flex; justify-content:center; align-items:center; padding:10px 0;">
  <img src="dist/img/LogoLabunicaFont.png" alt="AdminLTE Logo"  style="max-width:20%; height:auto; display:block;">
  <span class="brand-text font-weight-light"></span>
  </a>
  <div class="card">

    <div class="card-body register-card-body">
      <p class="login-box-msg">Daftarkan Pengguna Baru</p>

<form action="../../index.html" method="post">
  <!-- Full Name -->
  <div class="input-group mb-3">
    <input type="text" class="form-control" placeholder="Full name" required>
    <div class="input-group-append">
      <div class="input-group-text">
        <span class="fas fa-user"></span>
      </div>
    </div>
  </div>

  <!-- Email -->
  <div class="input-group mb-3">
    <input type="email" class="form-control" placeholder="Email" required>
    <div class="input-group-append">
      <div class="input-group-text">
        <span class="fas fa-envelope"></span>
      </div>
    </div>
  </div>

  <!-- Cohort (Dropdown) -->
  <div class="input-group mb-3">
    <select class="form-control" required>
      <option value="" disabled selected>Pilih Cohort</option>
      <option value="cohort1">Cohort 2</option>
      <option value="cohort2">Cohort 3</option>
      <option value="cohort3">Cohort 4</option>
      <option value="cohort3">Cohort 5</option>
    </select>
    <div class="input-group-append">
      <div class="input-group-text">
        <span class="fas fa-users"></span>
      </div>
    </div>
  </div>

  <!-- Prodi (Dropdown) -->
  <div class="input-group mb-3">
    <select class="form-control" required>
      <option value="" disabled selected>Pilih Prodi</option>
      <option value="prodi1">Kimia</option>
      <option value="prodi2">Biologi</option>
      <option value="prodi3">Matematika</option>
      <option value="prodi3">Fisika</option>
      <option value="prodi3">RSDA</option>
    </select>
    <div class="input-group-append">
      <div class="input-group-text">
        <span class="fas fa-graduation-cap"></span>
      </div>
    </div>
  </div>

  <!-- Password -->
  <div class="input-group mb-3">
    <input type="password" class="form-control" placeholder="Password" required>
    <div class="input-group-append">
      <div class="input-group-text">
        <span class="fas fa-lock"></span>
      </div>
    </div>
  </div>

  <!-- Retype Password -->
  <div class="input-group mb-3">
    <input type="password" class="form-control" placeholder="Retype password" required>
    <div class="input-group-append">
      <div class="input-group-text">
        <span class="fas fa-lock"></span>
      </div>
    </div>
  </div>

  <!-- Register Button -->
  <div class="row">
    <div class="col-12">
      <button type="submit" class="btn btn-primary btn-block">Register</button>
    </div>
  </div>

  <!-- Generate Password Link -->
  <a href="login.html" class="text-center">Generate Password</a> 
</form>
  <a href="login.html" class="text-center">Manage Users</a> 
</form>



    
      
